def executar(url):
    try:
        ip = socket.gethostbyname(url[7:])
        with sync_playwright() as p:
            browser = p.chromium.launch(headless=False)
            page = browser.new_page()
            page.goto(url)
            titulo = page.title()
            print(f'{url} está acessando, titulo da pagina: {titulo}')
            browser.close()
    except socket.gaierror:
        print(f'{url} não existe')

